//header-navigation bar

const profile="PROFILE";
const home="HOME";
const contact="CONTACT";
const about="ABOUT"

export const navigationContent={profile,home,contact,about};



//FeaturedItems-container

const heading="FEATURED ITEMS";
export const featuredContent={heading};


////sort
const sortHeading="SortBy"
export const sortSpace={sortHeading};


//filter
const filterHeading="Filter"
export const filterSpace={filterHeading};


//productDetails
//watch1
const appleWatchName="Apple Watch Ultra (GPS + Cellular)"
const appleBrand="Apple"
const appleWatchRating=5
const appleWatchPrice=100000
//watch2
const fasttrackWatchName="Fast-Track Watch Ultra (GPS + Cellular)"
const fastTrackBrand="FastTrack"
const fastTrackWatchRating=4.3
const fastTrackWatchPrice=20000
//watch3
const casioWatchName="Casio Watch Ultra (GPS + Cellular)"
const casioBrand="Casio"
const casioWatchRating=4.6
const casioWatchPrice=30000


export const productDetails={appleWatchName,appleBrand,appleWatchPrice,appleWatchRating,fastTrackBrand,fastTrackWatchRating,fastTrackWatchPrice,casioWatchName,casioBrand}
